package com.example.presidentrecycleviewtutorial;

import androidx.appcompat.app.AppCompatActivity;
import androidx.recyclerview.widget.LinearLayoutManager;
import androidx.recyclerview.widget.RecyclerView;

import android.content.Intent;
import android.os.Bundle;
import android.util.Log;
import android.view.View;
import android.widget.Button;

import java.util.ArrayList;
import java.util.Arrays;
import java.util.List;

public class MainActivity extends AppCompatActivity {

    private RecyclerView recyclerView;
    private RecyclerView.Adapter mAdapter;
    private RecyclerView.LayoutManager layoutManager;

    Button addOne;
    List<President> presidents;

    final static String TAG = "Presidents App";

    @Override
    protected void onCreate(Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);
        setContentView(R.layout.activity_main);


        presidents = new ArrayList<>();
        fillPresident();
        Log.d(TAG, "onCreate: " + presidents);
        addOne = findViewById(R.id.addOne);

        addOne.setOnClickListener(new View.OnClickListener() {
            @Override
            public void onClick(View v) {
                Intent intent = new Intent(MainActivity.this, AddEditOne.class);
                startActivity(intent);
            }
        });

        recyclerView = findViewById(R.id.presRecLayout);
        recyclerView.setHasFixedSize(true);

        layoutManager = new LinearLayoutManager(this);
        recyclerView.setLayoutManager(layoutManager);

        mAdapter = new RecyclerViewAdapter(presidents, MainActivity.this);
        recyclerView.setAdapter(mAdapter);

    }


    private void fillPresident() {

        President p0 = new President(0, "George Washington", 1789, "data:image/jpeg;base64,");
        President p1 = new President(1, "John Adams", 1797, "data:image/jpeg;base64,");
        President p2 = new President(2, "Thomas Jefferson", 1801, "data:image/jpeg;base64,");
        President p3 = new President(3, "Abraham Lincoln", 1861, "data:image/jpeg;base64,");
        President p4 = new President(4, "Theodore Roosevelt", 1901, "data:image/jpeg;base64,");
        President p5 = new President(5, "Franklin D. Roosevelt", 1933, "data:image/jpeg;base64,");
        President p6 = new President(6, "Dwight D. Eisenhower", 1952, "data:image/jpeg;base64,");
        President p7 = new President(7, "Lyndon B. Johnson", 1963, "data:image/jpeg;base64,");
        President p8 = new President(8, "Richard Nixon", 1969, "data:image/jpeg;base64,");
        President p9 = new President(9, "Barack Obama", 2008, "data:image/jpeg;base64,");

        presidents = Arrays.asList(new President[]{p0, p1, p2, p3, p4, p5, p6, p7, p8, p9});
    }
}